  false,\n\t\"url\": null,\n\t\"notes\": \"<p>To help consumers with a wide range
  of private health insurance questions and complaints, the Affordable Care Act created
  the Consumer Assistance Program Grants (CAP). CAP Grants provide nearly 30 million
  dollars in new resources to help States and territories establish or strengthen
  consumer assistance programs. CAP Grants were awarded in October 2010 and 38 States
  and Territories are using these resources to empower consumers and provide direct
  services to answer health<br />ninsurance questions. Data reported for the first
  year of the program (October 2010-October 2011) demonstrate the significant impact
  these programs have already made.</p>n\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
